import axios from "axios";
import {appConstants} from "../constants/constant";

const API = 'http://localhost:8089';

export const matching = (matchdata, success, failure) => {
    const matchingPromise = axios.get(`${API}/applications/matching`, matchdata)
        .then(res => {
            return res;
        })
        .catch(err => {
            typeof failure === 'function' && failure(err);
            return err;
        });

    return {
        type: appConstants.MATCHING,
        payload: matchingPromise
    };
};
